    var binaryGap = function(N) {
        N = N.toString(2)
        var ld = 0,max = 0
        for(var i = 0 ; i < N.length ; i++)
            for(var j = i + 1 ;j < N.length ;j++)
            {
                if(N.charAt(i) == 1)
                {
                    if(N.charAt(j) == 1 )
                    {
                        ld = j - i 
                        if(max < ld)
                        {
                            max = ld
                            break
                        }
                        else if(max >= ld)
                            break
                    }
                }
                else 
                    break
                
            } 
        return max
    };
